import { Helmet } from 'react-helmet';
import { useHistory } from 'react-router-dom';
import Navbar8 from '../components/navbar8';
import Footer4 from '../components/footer4';
import '../style.css';
import './produits.css';

const Produits = () => {
  const history = useHistory();

  // Fonctions de navigation
  const handleAcheter = () => history.push('/Achat');
  const handleHome = (e) => {
    e.preventDefault();
    history.push('/');
  };

  // DonnÃ©es des produits
  const produits = [
    // ... (conservez votre tableau de produits existant)
  ];

  return (
    <div className="produits-container">
      <Helmet>
        <title>Nos Produits CosmÃ©tiques</title>
        <meta property="og:title" content="Nos Produits CosmÃ©tiques" />
      </Helmet>
      
      {/* Navbar avec les mÃªmes props que Home.js */}
      <Navbar8
        page4Description={
          <Fragment>
            <span className="home-text100">
              Contactez-nous pour toute question, collaboration ou retour. Nous serions ravis de vous entendre.
            </span>
          </Fragment>
        }
        action1={
          <Fragment>
            <button onClick={handleAcheter} className="home-button">
              Acheter Maintenant
            </button>         
          </Fragment>
        }
        link2={
          <Fragment>
            <span className="thq-link thq-text-primary">Produits</span>
          </Fragment>
        }
        page1={
          <Fragment>
            <span className="home-text103">Home</span>
          </Fragment>
        }
        link1={
          <Fragment>
            <a href="/" onClick={handleHome} className="thq-link thq-text-primary">Home</a>
          </Fragment>
        }
        page4={
          <Fragment>
            <span className="home-text105">Contact</span>
          </Fragment>
        }
        page2={
          <Fragment>
            <span className="home-text106">Produits</span>
          </Fragment>
        }
        link4={
          <Fragment>
            <span className="home-text107">Contact</span>
          </Fragment>
        }
        page1Description={
          <Fragment>
            <span className="home-text108">
              Bienvenue sur le site de notre marque de cosmÃ©tiques. DÃ©couvrez notre gamme de produits de haute qualitÃ©.
            </span>
          </Fragment>
        }
        page2Description={
          <Fragment>
            <span className="home-text109">
              Explorez notre collection de soins de la peau et de produits de beautÃ© conÃ§us pour sublimer votre beautÃ© naturelle.
            </span>
          </Fragment>
        }
        link3={
          <Fragment>
            <span className="home-text110">Ã propos de nous</span>
          </Fragment>
        }
        page3={
          <Fragment>
            <span className="home-text111">A propos de nous</span>
          </Fragment>
        }
        page3Description={
          <Fragment>
            <span className="home-text112">
              DÃ©couvrez l'histoire de notre marque, ses valeurs et son engagement pour la beautÃ© et le dÃ©veloppement durable.
            </span>
          </Fragment>
        }
        action2={
          <Fragment>
            <span className="home-text113">En savoir Plus</span>
          </Fragment>
        }
      />
      
      {/* Contenu principal de la page Produits */}
      <main className="produits-main-content">
        <section className="thq-section-padding kl-produits-section">
          <div className="thq-section-max-width">
            <h1 className="thq-heading-1 kl-produits-title">Nos Produits CosmÃ©tiques</h1>
            <p className="thq-body-large kl-produits-subtitle">
              DÃ©couvrez notre gamme exclusive de produits de beautÃ© de haute qualitÃ©
            </p>

            <div className="thq-grid-auto-300 kl-produits-grid">
              {produits.map((produit) => (
                <div key={produit.id} className="thq-card kl-produit-card">
                  <img 
                    src={produit.imageSrc} 
                    alt={produit.nom}
                    className="thq-img-ratio-4-3 kl-produit-image"
                  />
                  <div className="kl-produit-content">
                    <h3 className="thq-heading-3 kl-produit-nom">{produit.nom}</h3>
                    <p className="thq-body-small kl-produit-description">{produit.description}</p>
                    <div className="kl-produit-infos">
                      <span className="thq-body-small kl-produit-prix">{produit.prix}</span>
                      <span className={`thq-body-small kl-produit-stock ${produit.stock.includes("Rupture") ? "kl-rupture" : ""}`}>
                        {produit.stock}
                      </span>
                    </div>
                    <button className="thq-button-filled kl-produit-button">
                      Ajouter au panier
                    </button>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </section>
      </main>
      
      {/* Footer avec les mÃªmes props que Home.js */}
      <Footer4
        link5={
          <Fragment>
            <span className="home-text212">FAQs</span>
          </Fragment>
        }
        link3={
          <Fragment>
            <span className="home-text213">A propos de nous</span>
          </Fragment>
        }
        link1={
          <Fragment>
            <span className="home-text214">Home</span>
          </Fragment>
        }
        termsLink={
          <Fragment>
            <span className="home-text215">Terms &amp; Conditions</span>
          </Fragment>
        }
        link2={
          <Fragment>
            <span className="home-text216">Produits</span>
          </Fragment>
        }
        link4={
          <Fragment>
            <span className="home-text217">Nous Contacter</span>
          </Fragment>
        }
        cookiesLink={
          <Fragment>
            <span className="home-text218">Cookies Policy</span>
          </Fragment>
        }
        privacyLink={
          <Fragment>
            <span className="home-text219">Politique privÃ©e</span>
          </Fragment>
        }
      />
    </div>
  );
};

export default Produits;
